import "./App.css";
import onlineStore from "./mobile-shopping.png";
import { Products, products } from "./Products";

function App() {
  return (
    <div>
      <div className="d-flex align-items-center mt-4 flex-column">
        <img src={onlineStore} width="10%" />
        <h1>Sarah's Store</h1>
        <p>welcome to Sarah's Store</p>
      </div>
      {products.map((item) => (
        <Products
          name={item.name}
          image={item.image}
          price={item.price}
        ></Products>
      ))}
    </div>
  );
}

export default App;
